import React from 'react';
import { PropTypes } from 'prop-types';
import './Card.css'
import CardBack from '../images/back_card.jpg';

function Card(props) {
    return (
        <div className="card">
           <input type="image" className="img-card" src={CardBack}></input>
        </div>
    )
}

Card.propTypes  = {
    number: PropTypes.number
}

export default Card;
